import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

export default function Home() {
  function SubmitImg(e) {
    e.preventDefault();

    const bodyFormData = new FormData(e.target);
    const [img, setImg] = useState("");
    setImg(bodyFormData);
    this.setState({ evento: bodyFormData });
    NavigateToNewView(img);
  }

  function NavigateToNewView(img) {
    let navigate = useNavigate();
    navigate("./ resultado", { img });
  }

  return (
    <body>
      <h2>Detectar Objeto</h2>

      <form onSubmit={(e) => SubmitImg(e)} encType="multipart/form-data">
        <input type="file" name="img1" />
        <button type="submit">Submit</button>
      </form>
    </body>
  );
}
